import React from 'react';

function CardNumberInput() {
  return (
    <div className='w-full flex flex-col gap-2'>
      <label className="uppercase tracking-widest text-xs font-semibold" style={{color: 'hsl(278, 68%, 11%)'}} htmlFor="">Card Number</label>
      <input className='border-[.5px] border-solid focus:border-violet-800 p-2 outline-none rounded-lg' type="text" placeholder='e.g. Jane Applessed' />
    </div>
  )
}
export default CardNumberInput;
